//  -> 더미 데이터에서 isfollowing 이 y인 사람만 파싱? 으로 처리 하여 
//     나타나는 것은 닉네임으로 표현하기 
// 팔로잉 추가 함수
// 팔로잉 삭제 함수 


export default function Following() {
    return (
        <Box 
        sx={{ width: '98%', bgcolor: 'background.paper' }} 
        textAlign='center' 
        style={{ margin : 5, position:'relative'}}>
            <p>Following</p>
        </Box>
    )
}
